import React, { useEffect } from "react";
import "./App.css";
import { useApiGet, TApiResponse } from "./hooks/useApiHook";

const App: React.FC = () => {
  // call to the hook

  useEffect(() => {
    const data: TApiResponse = useApiGet("https://restcountries.com/v2/all/");
    const numbersCopy = JSON.parse(JSON.stringify(data));

    console.log(numbersCopy);
  }, []);

  // print the output
  //if (!data.loading) console.log(data);

  return <div className="App"></div>;
};

export default App;
